import "./home.css"
import {PostList} from "../../components";
import {useDispatch} from "react-redux";
import {useEffect} from "react";
import {getAllUsers} from "../../redux/usersSlice";

const Home = () => {

    const dispatch = useDispatch()
    useEffect(() => {
        dispatch(getAllUsers())
    }, []);

    return (
        <PostList/>
    )
}

export default Home
